        <div className="Color" style={{ backgroundColor: props.hex}}>
            <div>
            <p>this is {props.color}.</p>
            <p>How beautiful!</p>
            <p>
                <Link to="/">Return to Color Selector</Link>
            </p>
            </div>
        </div>
    );
}

